import React from 'react';
import { AppBar , Toolbar } from "@material-ui/core";

const Pokedex = () => {
    return (
        <>
            <AppBar position = "static">
                <Toolbar />
            </AppBar>
            <div>TEXT YOOO</div>
        </>
    )
}

export default Pokedex;
